INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (56001, 10785, 'Hyoscyamine', 'Hyperthyroidism', 'In general, agents with anticholinergic activity may exacerbate hyperthyroidism.  Therapy with anticholinergics should be administered cautiously in patients with hyperthyroidism.  Thyroid levels should be monitored if usage is prolonged.', '1', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (56002, 10785, 'Hyoscyamine', 'Diarrhea', 'Diarrhea may be a symptom of incomplete intestinal obstruction, especially in patients with ileostomy or colostomy.  Antimuscarinic agents may further aggravate the diarrhea.  Therefore, these drugs should be administered cautiously in patients with diarrhea.', '1', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (56003, 10785, 'Hyoscyamine', 'Fever', 'Atropine-like agents may increase the risk of hyperthermia in patients with fever by producing anhidrosis.  Therapy with atropine-like agents should be administered cautiously in febrile patients.', '1', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (56004, 429, 'Ibuprofen', 'Asthma', 'Nonsteroidal anti-inflammatory drugs (NSAIDs) are contraindicated in patients with history of asthma, urticaria, or other allergic-type reactions after taking aspirin or other NSAIDs; severe, sometimes fatal, anaphylactic reactions to NSAIDs have been reported in such patients.  A subpopulation of patients with asthma may have aspirin-sensitive asthma which may include chronic rhinosinusitis complicated by nasal polyps, severe potentially fatal bronchospasm, and/or intolerance to aspirin and other NSAIDs.  Since cross-reactivity between aspirin and other NSAIDs has been reported in such aspirin-sensitive patients, therapy with any NSAID should be avoided in patients with this form of aspirin sensitivity.  NSAIDs should be used with caution in patients with preexisting asthma (without known aspirin sensitivity), and these patients should be monitored for changes in the signs and symptoms of asthma.', '3', '', 'DDInter', 0);
